import React, { Component } from 'react';

class Game {

    constructor(dimension) {

    }

    blankGrid(dimension) {
        const grid = [];
        for(let i = 0; i < dimension; i++) {
            grid.push(Array(dimension).fill(0));
        }
        return grid;
    }
}

export default Game;
